import React from 'react';
import homepage from '../assets/images/homepage.jpg';
import homepage3 from '../assets/images/homepage3.jpg';
import { useEffect } from 'react';
function Corousal(props) {
    useEffect=() => {
        setInterval(()=>{
            document.getElementById("carouselExampleSlidesOnly").style.display="none";
            document.getElementById("carouselExampleSlidesOnly").style.display="block";
        },2000)
    }
    return (

            <div id="carouselExampleSlidesOnly" class="carousel slide cross-fade" data-ride="carousel">
                <div class="carousel-inner">
                    <div class="carousel-item active " data-bs-interval="1000">
                        <img class="d-block w-100" src={homepage} alt="First slide"/>
                    </div>
                    <div class="carousel-item"data-bs-interval="1000">
                        <img class="d-block w-100" src={homepage3} alt="Second slide"/>
                    </div>

                </div>
            </div>

    );
}

export default Corousal;
